import { Row, Col } from "react-bootstrap";

const PhotoBanner = () => {
  return (
    <section className="front-page-slide">
      <div className="overlay">
        <div>
          <article>
            <h3>Interaktywne formularze online</h3>
            <p>
              Dzięki temu narzędziu w szybki i prosty sposób wypełnisz dostępne
              formularze bez sięgania po długopis. System ten zapewni Ci pełną
              poprawność każdego wypełnionego wniosku.
            </p>
          </article>
        </div>
      </div>
    </section>
  );
};

export default PhotoBanner;
